import Link from 'next/link'

const Book = () => {

  return (
    <div className="book">
      <p classNames="book__soon">Our book will be available soon for free!<br/></p>
      <Link classNames="book__back" href="/home/storyfeld">Go back to Home</Link>
    </div>
  )
}

export default Book
